    <script type="text/javascript">
        ymaps.ready(function () {
        var myMap = new ymaps.Map('map', {
            center: [50.2833322, 57.166666],
            zoom: 10.5
        }, {
            searchControlProvider: 'yandex#search'
        }),

        // Creating a content layout.
        MyIconContentLayout = ymaps.templateLayoutFactory.createClass(
            '<div style="color: #FFFFFF; font-weight: bold;">$[properties.iconContent]</div>'
        ),

        centerOfCity = new ymaps.Placemark(myMap.getCenter(), {
            hintContent: 'This is the center of city',
            balloonContent: 'Aktobe is pretty nice city)'
        }, {
            /**
             * Options.
             * You must specify this type of layout.
             */
            iconLayout: 'default#image',
            // Custom image for the placemark icon.
            iconImageHref: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRydYmNf4Q-6_pNcy003ikY7RBYYIEjuBCO8g&usqp=CAU',
            // The size of the placemark.
            iconImageSize: [42, 42],
            /**
             * The offset of the upper left corner of the icon relative
             * to its "tail" (the anchor point).
             */
            iconImageOffset: [-5, -38]
        }),

        ourOffice = new ymaps.Placemark([50.321349, 57.335123], {
            hintContent: 'We are located here',
            balloonContent: "It's our office"  
        }, {
            /**
             * Options.
             * You must specify this type of layout.
             */
            iconLayout: 'default#imageWithContent',
            // Custom image for the placemark icon.
            iconImageHref: 'data:image/jpeg;base64,',
            // The size of the placemark.
            iconImageSize: [48, 48],
            /**
             * The offset of the upper left corner of the icon relative
             * to its "tail" (the anchor point).
             */
            iconImageOffset: [-24, -24],
            // Offset of the layer with content relative to the layer with the image.
            iconContentOffset: [15, 15],
            // Content layout.
            iconContentLayout: MyIconContentLayout
        });

        ourAirport = new ymaps.Placemark([50.248122, 57.209917], {
            hintContent: 'This is our airport',
            balloonContent: 'Our aiport is pretty nice as well',
        }, {
            /**
             * Options.
             * You must specify this type of layout.
             */
            iconLayout: 'default#imageWithContent',
            // Custom image for the placemark icon.
            iconImageHref: 'data:image/png;base64,',
            // The size of the placemark.
            iconImageSize: [48, 48],
            /**
             * The offset of the upper left corner of the icon relative
             * to its "tail" (the anchor point).
             */
            iconImageOffset: [-30, -30],
            // Offset of the layer with content relative to the layer with the image.
            iconContentOffset: [50, 50],
            // Content layout.
            iconContentLayout: MyIconContentLayout
        });

    myMap.geoObjects
        .add(centerOfCity)
        .add(ourOffice)
        .add(ourAirport);
    });
    </script>
